import React from 'react'
import { BrowserRouter, Switch } from "react-router-dom"
import { connect } from 'react-redux'
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Login from './components/login/Login'
import Dashboard from './components/dashboard'
import SignUp from './components/signup/Signup'
import User from './components/user/User'
import PlanDetails from './components/planDetails/PlanDetails'
import PrivateRoute from './utils/PrivateRoute';
import PublicRoute from './utils/PublicRoute';
import  configureStore from './modalStore/store'
import { Provider } from 'react-redux';

const Store = configureStore();
function App() {

  toast.configure({
    autoClose: 6000
  });

  return (
    <Provider store={Store}>
      <BrowserRouter>
        <Switch>
          <PublicRoute path="/signup" restricted={false} component={SignUp} />
          <PublicRoute exact path="/" restricted={true} component={Login} />
          <PrivateRoute path="/dashboard" component={Dashboard} />
          <PrivateRoute path="/user" component={User} />
          <PrivateRoute path="/plandetails" component={PlanDetails} />
        </Switch>
      </BrowserRouter>
    </Provider>
  )
}

export default connect(null,null)(App);
